import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import './styles.css';

const users = [
    {
        id: 1,
        name: 'John Doe',
        email: 'john.doe@example.com',
        role: 'SuperUser',
        image: 'user1.jpg'
    },
    {
        id: 2,
        name: 'Jane Smith',
        email: 'jane.smith@example.com',
        role: 'Moderator',
        image: 'user2.jpg'
    },
    {
        id: 3,
        name: 'Jane Smith',
        email: 'jane.smith@example.com',
        role: 'Moderator',
        image: 'user2.jpg'
    },
    {
        id: 4,
        name: 'Jane Smith',
        email: 'jane.smith@example.com',
        role: 'Moderator',
        image: 'user2.jpg'
    },
    {
        id: 5,
        name: 'Jane Smith',
        email: 'jane.smith@example.com',
        role: 'Moderator',
        image: 'user2.jpg'
    },
    {
        id: 6,
        name: 'Jane Smith',
        email: 'jane.smith@example.com',
        role: 'Moderator',
        image: 'user2.jpg'
    },
    // Add more user objects as needed
];


const AllMessages = () => {

  return (
    <div className="all-messages">
       <h1>Welcome to User Registration</h1>
      <div className="message-cards">
        {messages.map(user => (
          <div className="message-card" key={user.id}>
            <p><strong>Name:</strong> {user.name}</p>
            <p><strong>Email:</strong> {user.email}</p>
            <p><strong>Roll:</strong> {user.role}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AllMessages;
